import React, { Component } from 'react';



import { Container, Card, ListGroup, Button} from 'react-bootstrap';


function Note(props) {
    return <li>{props.intext}</li>
  }


class Far extends Component {
     handleChange = event => {
        this.setState({ username: event.target.value });
      };


    render() { 
        const notes = [
            {intext : 'hello i am a first note'},
            {intext : 'i am the second one'},
            {intext : 'i third'},
            {intext : 'yeehawww'}    
        ]



        return ( 
        <div>
            <Container fluid>
            <Card
                bg={'info'}
                style={{ width: '18rem' }}
                className='rounded-0 mb-2 text-center'
            >
            <Card.Header>What the world <br></br><b>NEEDS</b></Card.Header>
            <Button>Add</Button>
            <Card.Body>
            <Card.Text>
            <ul>
                <div class="col-md-12">
                <div class="form-group">
                <label for="nameText" class="control-label"></label>
                <div class="input-group">
                <input id="nameText" type="text" class="form-control" value = {notes[0].intext}></input>
                <div class="input-group-btn">
                <button type="button" class="btn btn-danger">
                X
                </button>
                </div>
                </div>
                </div>
                </div>


                {notes.map((element) => <Note intext ={element.intext}></Note>)}
            </ul>

            </Card.Text>
            </Card.Body>
            </Card>
            </Container>
        </div>
        );
    }
}

export default Far;
